import React from "react";


const Text = ({text}) => {
    return (
        <div className="container">
            <div className="text">
                {text.heading ? <h2>{text.heading}</h2> : ''}
                {text.text ? <p>{text.text}</p>:''}
            </div>
        </div>
    );
};

export default Text;
